import React from "react";
import { Route, Routes } from "react-router-dom";
import { Landing, Login, NotFound, Registration } from "../index.js";
import { SneakersRoutes } from "./SneakersRoutes.jsx";
import { Navbar } from "./navbar.jsx";

export const Router = () => {
  return (
    <Routes>
      <Route path="/" element={<Landing />} />
      <Route path="/sneakers">
        <Route index element={<Navbar />} />
        <Route element={<SneakersRoutes />} />
      </Route>
    </Routes>
  );
};
